import { NavLink } from 'react-router-dom';


const Navigation = () => {
    return(
        <ul class="sidenav">
  <li><a class="active" href="#home">Home</a></li>
  <li><a href="#news">News</a></li>
  <li><a href="#contact">Contact</a></li>
  <li><a href="#about">About</a></li>
</ul>
        
    );
}

export default Navigation;
